def int_to_bytes(num):

    if num == 0:
        return b'0'
    nums = [b'0', b'1', b'2', b'3', b'4', b'5', b'6', b'7', b'8', b'9']
    b = b''
    if num < 0:
        sign = b'-'
        num = 0 - num
    else:
        sign = b''
    while num != 0:
        b = nums[num % 10] + b
        num //= 10
    return sign + b

