    if units not in ["pt", "cm", "mm", "in", "inches", "px"]:
        raise ValueError("please constrain units string parameter to "+\
                         "options listed in doc string")

    if units == "pt":
        return value

    # metric to inches
    if units == "cm":
        value = value/2.54
        units = "in"

    if units == "mm":
        value = value/25.4
        units = 'in'

    # inches to pixels
    if units == "in" or units == "inches":
        value = value * dpi
        units = "px"

