def interval_overlap_length(i1,i2):

    (a,b) = i1
    (c,d) = i2
    if a<c:
        if b<c:
            return 0.
        elif b<d:
            return b-c
        else:
            return d-c
    elif a<d:
        if b<d:
            return b-a
        else:
            return d-a
    else:
        return 0

def weighted_sum(df, col, w=None):

    if w is None:
        return df[col].sum()
    return (df[col] * df[w]).sum()

