# Example Interval class to work with
class Interval:
    def __init__(self, start, end):
        self.start = start
        self.end = end

    def merge(self, other):
        new_start = min(self.start, other.start)
        new_end = max(self.end, other.end)
        return Interval(new_start, new_end)

