def geometric_key2(xy, precision='3f', tolerance=1e-9, sanitize=True):

    x, y = xy
    if precision == 'd':
        return '{0},{1}'.format(int(x), int(y))
    if sanitize:
        tolerance = tolerance ** 2

        if x ** 2 < tolerance:
            x = 0.0
        if y ** 2 < tolerance:
            y = 0.0
    return '{0:.{2}},{1:.{2}}'.format(x, y, precision)

